Information
------------------------------

Shortly before dawn on December 16, 1944, US troops controlling the Ardennes sector of France were pulverized by massive German artillery bombardment. At 5:30 a.m., a German force of 275.000 men and over 2.000 Panzers rolled forward. The German counteroffensive, the Battle of the Bulge, had begun. Germans and Americans will fight in difficult weather conditions until January 1945. It was Hitler's last great gamble in the West, which would bring two commanders into direct confrontation: US General Omar Bradley and Hitler's Field Marshal Walter Model.

Produced by Nugus/Martin Productions Ltd for The History Channel

